import React from 'react';
import setBoard from './App.js';
import onClickButton from './App.js';

export function Board(props, val) {
  return (
    <div class="board">
        <div class="box" onClick={() => props.name(0)}>{val[0]}X</div>
        <div class="box" onClick={() => props.name(1)}>{val[1]}</div>
        <div class="box" onClick={() => props.name(2)}>{val[2]}</div>
        <div class="box" onClick={() => props.name(3)}>{val[3]}</div>
        <div class="box" onClick={() => props.name(4)}>{val[4]}</div>
        <div class="box" onClick={() => props.name(5)}>{val[5]}</div>
        <div class="box" onClick={() => props.name(6)}>{val[6]}</div>
        <div class="box" onClick={() => props.name(7)}>{val[7]}</div>
        <div class="box" onClick={() => props.name(8)}>{val[8]}</div>
    </div>
  );
}
